import heapq
import collections

def timsort(arr, n):
    n = len(arr)
    if n <= 1:
        return arr
    sorted_arr = sorted(arr, key=lambda x: x)

    parent = collections.defaultdict(int)
    for i in range(n):
        parent[sorted_arr[i]] += 1

    heap = collections.defaultdict(list)
    heapq.heappush(heap, sorted_arr)

    for key in parent:
        parent[key] -= 1
        for item in heap:
            if parent[item] < parent[key]:
                heapq.heappush(heap, item)

    return heapq.heapify(heap)
```

